from bs4 import BeautifulSoupimport requestsdef scraper():    print('Enter URL:')    url = input()    r = requests.get(url)    data = r.content    soup = BeautifulSoup(data,'html.parser')    link_list = []    if 'yahoo' in url:        for x in soup.find_all('ol', class_= 'mb-15 reg searchCenterMiddle'):            for y in x.find_all('a'):                if '98.139.21.31' not in (y.get('href')):                    link_list.append(y.get('href'))    if 'bing' in url:        for x in soup.find_all('ol', id= 'b_results'):            for y in x.find_all('a'):                if isinstance((y.get('href')), str) and 'search?q' not in y.get('href'):                    link_list.append(y.get('href'))    if 'ask' in url:        for x in soup.find_all('div', class_= 'l-web-results web-results content-mid'):            for y in x.find_all('a'):                link_list.append(y.get('href'))    print(link_list)if __name__ == '__main__':    scraper()